import React from "react";

function article_1() {
	return {
		date: "June 2018",
		title: "Completed my A-Levels",
		keywords: [
			"Deployment",
			"Bijan",
			"Bijan Saud",
		],
		style: `
				.article-content {
					display: flex;
					flex-direction: column;
					align-items: center;
				}

				.randImage {
					align-self: center;
					outline: 2px solid red;
				}
				`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph">I Completed my A-Levels from St.Xaiers College in Nepal.</div>
					<img
						src="./college.jpg"
						alt="random"
						className="randImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}

function article_2() {
	return {
		date: "2019",
		title: "I joined University of Dallas ",
		description:
			"At University of Dallas I studies the basics of programming, Algorithm, and much more on Programming Styles.",
		keywords: [
				"Deployment",
				"Bijan",
				"Bijan Saud",
			],
		style: `
					.article-content {
						display: flex;
						flex-direction: column;
						align-items: center;
					}

					.randImage {
						align-self: center;
						outline: 2px solid red;
					}
					`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph"></div>
					<img
						src="https://www.shutterstock.com/image-vector/group-people-laughing-lol-isolated-vector-1390409888"
						alt="random"
						className="randImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}

function article_3() {
	return {
		date: "2021",
		title: "I Transferred to University of Texas At Arlington ",
		description:
			"At UTA I polished my skills as a developer, studied programming concepts, Algorithms, Data Structures, Information Security, Design Patterns, .... ",
		keywords: [
				"Deployment",
				"Bijan",
				"Bijan Saud",
			],
		style: `
					.article-content {
						display: flex;
						flex-direction: column;
						align-items: center;
					}

					.randImage {
						align-self: center;
						outline: 2px solid red;
					}
					`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph"></div>
					<img
						src="https://www.shutterstock.com/image-vector/group-people-laughing-lol-isolated-vector-1390409888"
						alt="random"
						className="randImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}

function article_4() {
	return {
		date: "2003",
		title: "Departed from birth Place",
		description:
			"For better opporunities, ",
		keywords: [
				"Deployment",
				"Bijan",
				"Bijan Saud",
			],
		style: `
					.article-content {
						display: flex;
						flex-direction: column;
						align-items: center;
					}

					.randImage {
						align-self: center;
						outline: 2px solid red;
					}
					`,
		body: (
			<React.Fragment>
				<div className="article-content">
					<div className="paragraph"></div>
					<img
						src="https://www.shutterstock.com/image-vector/group-people-laughing-lol-isolated-vector-1390409888"
						alt="random"
						className="randImage"
					/>
				</div>
			</React.Fragment>
		),
	};
}




const myArticles = [article_1, article_2, article_3,article_4];

export default myArticles;
